webpackJsonp([0x812be5f1a96c],{765:function(e,a){e.exports={data:{contentfulBlogPost:{title:"[codewars] Array.diff",id:"c5YjeZauJaM64IK6uYQ6IKi",tags:["general"],publishDate:"June 1st, 2018",heroImage:{file:{url:"//images.ctfassets.net/hu4faubeotg0/6hBUhX5xKgUs0WAGGQOK8k/9b9aed31763f88e8668bb1a6a9e69236/codewars.jpg"}},body:{childMarkdownRemark:{html:"<p>Your goal in this kata is to implement a difference function, which subtracts one list from another and returns the result.</p>\n<p>It should remove all values from list a, which are present in list b.</p>\n<pre><code>array_diff([1,2],[1]) == [2]\n</code></pre>\n<p>If a value is present in b, all of its occurrences must be removed from the other:</p>\n<pre><code>array_diff([1,2,2,2,3],[2]) == [1,3]\n</code></pre>\n<p>my answer</p>\n<pre><code>const array_diff = (a, b) => a.filter(x => b.indexOf(x) === -1 );\n</code></pre>\n<p>best practice</p>\n<pre><code>function array_diff(a, b) {\n  return a.filter(e => !b.includes(e));\n}\n</code></pre>"}}}},pathContext:{slug:"codewars-array-diff"}}}});
